import { backendAPI } from '../../api';
export class UserService {
  async create(username, password, email, recaptcha, betaCode) {
    const user = await backendAPI.post('users', {
      username,
      password,
      email,
      recaptcha,
      betaCode
    });
    return user.data;
  }

  async getByUsername(username) {
    const user = await backendAPI.get(`users/profile/${username}`);
    return user.data;
  }

  async getByID(userID) {
    const user = await backendAPI.get(`users/${userID}`);
    return user.data;
  }

  async getMostCredits() {
    const users = await backendAPI.get('users/leaderboard/credits');
    return users.data;
  }

  async getMostPixels() {
    const users = await backendAPI.get('users/leaderboard/pixels');
    return users.data;
  }

  async getMostPoints() {
    const users = await backendAPI.get('users/leaderboard/points');
    return users.data;
  }

  async getOnline() {
    const users = await backendAPI.get('users/online');
    return users.data;
  }

  async getUserOfTheWeek() {
    const users = await backendAPI.get('users/user-of-the-week');
    return users.data;
  }

}
export const userService = new UserService();
